Frelinghuysen, A.C., &quot;American Porcelain: 1770-1920&quot;
H.N. Abrams | 1989 | ISBN: 0870995405, 0810918870 | English | PDF | 320 pages | 42.69 Mb

Collection of American porcelain from the Metropolitan Museum. Published in conjunction with the exhibition American Porcelain: 1770-1920, held at the Metropolitan Museum of Art, New York, from 8 April 1989 until 25 June 1989.
